import React from 'react';
import { Link } from 'react-router-dom';
import Buttons from './buttons';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import { Nav } from 'react-bootstrap';

const NavBar = ({ login, logout, isAuthenticated }) => {
  return (
    <Navbar expand="lg" className="bg-body-tertiary">
      <Container>
        <Navbar.Brand as={Link} to="/Welcome">Your Brand Name</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          {isAuthenticated && (
            <Nav className="me-auto">
              <Nav.Link as={Link} to="/Facture" replace>Home</Nav.Link>
              <Nav.Link as={Link} to="/Reclamation" replace>Link</Nav.Link>
              <Nav.Link as={Link} to="/addReclamation" replace>Link</Nav.Link>
              {/* Add your additional navigation items here */}
            </Nav>
          )}
        </Navbar.Collapse>
        <Buttons login={login} logout={logout} />
      </Container>
    </Navbar>
  );
};

export default NavBar;
